import React from "react";
import Header from "parts/Header";
import Breadcrumb from "components/Breadcrumb";
import ProducsDetails from "parts/DetailsPage/ProducsDetails";
import Suggestion from "parts/DetailsPage/Suggestion";

import Sitemap from "parts/Sitemap";

import Footer from "parts/Footer";

const { data, error, run, isLoading, isError } = useAsync();

React.useEffect(() => {
  run(fetch({ url: `/api/products/${idp}` }));
}, [run, idp]);


export default function HomePage() {
  return (
    <>
      <Header theme ="black" />

      <Breadcrumb 
      list= {[
        {url: "/", name: "Home" },
        {url: "/categories/912312",  name:"Opfice room" },
        {url: "/categories/91231/products/7688", name:"Details" },
      ]}
      />

        <section class="md:py-16">
        <div class="container mx-auto px-4">
          <div class="flex -mx-4 flex-wrap">
            
          </div>
          </div>
          </section>
      <ProducsDetails />
      <Suggestion />
     
      <Sitemap />
      <Footer />
      
    </>
  )
}
